import React, { useRef , useState } from "react";
import  "./Card.css";
import romPlay from "../Wrapper/romPlay.js";
import SkipNextIcon from '@mui/icons-material/SkipNext';
import SkipPreviousIcon from '@mui/icons-material/SkipPrevious';
import { height } from "@mui/system";
export default function Latest(props){

    const audioElm = useRef();

    return(
        <>
           <div className="song">
                 <div class="card" style={{width:"15vw",height:"24rem",marginRight:"1rem"}}>
                   <img id="data-img" src={romPlay[props.num].img} class="card-img-top" alt="..."/>
                   <div class="card-body">
                      <h5 id="data-title" class="card-title">{romPlay[props.num].title}</h5>
                      <p id="data-artist" class="card-text">Artist: {romPlay[props.num].artist}</p>
                      <audio id="data-src" src={romPlay[props.num].src} className="play-pause" ref={audioElm}  controls></audio>
                    </div>
                </div>
           </div>
        </>
    )
}
